import { useState } from "react";
import Layout from "../components/layout/layout";

function Udashboard() {
  return (
    <Layout>
      <Topbar />
      <Content />
    </Layout>
  );
}

function Topbar() {
  const position = {
    container: "sm:mx-10",
    wrapper: "flex flex-col gap-10 sm:items-center sm:gap-40 md:flex-row",
    separator: "h-0.5 my-4",
    item: "flex gap-5",
  };
  const design = {
    heading: "text-2xl",
    text: "font-medium cursor-pointer",
    separator: "bg-gray-300",
  };
  const [heading, setHeading] = useState("Profile");

  return (
    <div className={position.container}>
      <div className={position.wrapper}>
        <h3 className={design.heading}>{heading}</h3>
        <div className={position.item}>
          {["Profile", "Inbox", "Orders", "Favourites", "Settings"].map(
            (item) => (
              <p
                className={`${design.text} ${
                  heading === item && "text-gray-500"
                }`}
                onClick={() => setHeading(item)}
              >
                {item}
              </p>
            ),
          )}
        </div>
      </div>
      <hr className={`${position.separator} ${design.separator}`} />
    </div>
  );
}

export default Udashboard;
